import React from 'react';
import './App.css';
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import Header from './Header';

const Home = () => {
    return <h2>Home</h2>;
};
const Blog = () => {
    return <h2>Blog</h2>;
};

function App() {
    return (
        <Router>
            <div>
                <Header />
                <main>
                    <Switch>
                        <Route exact path="/">
                            <Home />
                        </Route>
                        <Route exact path="/blog">
                            <Blog />
                        </Route>
                    </Switch>
                </main>
            </div>
        </Router>
    );
}

export default App;
